INSERT INTO `kpi` VALUES ('676', 'การตลาด-ยอดสั่งซื้อของลูกค้าเฉลี่ยต่อเดือน(หน่วย:ร้อยละ)', 'ยอดสั่งซื้อของลูกค้าเฉลี่ยต่อเดือน (≥ 80%) ใบสั่งซื้อ (PO), ใบตอบรับการเสนอราคา (ความถี่ ทุกเดือน)', '197', 'KPI007');
INSERT INTO `kpi` VALUES ('677', 'การตลาด-จำนวนลูกค้าที่ติดต่อเข้ามาเอง(หน่วย:ร้อยละ)', ' จำนวนลูกค้าที่ติดต่อเข้ามาเอง (≥ 90% ของลูกค้าทั้งหมด) บันทึก (สมุด/แบบฟอร์มการรับเรื่อง) (ความถี่ ทุกเดือน)', '197', 'KPI008');
INSERT INTO `kpi` VALUES ('678', 'ไอที-ผู้ปฎิบัติงานทางด้าน ICT ที่มีความรู้ความชำนาญเฉพาะทาง หรือผ่านการทดสอบมาตรฐานวิชาชีพ (หน่วย:ร้อยละ)', 'ผู้ปฎิบัติงานทางด้าน ICT ที่มีความรู้ความชำนาญเฉพาะทาง หรือผ่านการทดสอบมาตรฐานวิชาชีพ (หน่วย:ร้อยละ)', '197', 'KPI009');
INSERT INTO `kpi` VALUES ('680', 'ไอที-จำนวนครั้งของการถูกบุกรุก และระดับความปลอดภัยที่ยอมรับได้ (หน่วย:ครั้ง)', 'จำนวนครั้งของการถูกบุกรุก และระดับความปลอดภัยที่ยอมรับได้ (หน่วย:ครั้ง)', '197', 'KPI011');
INSERT INTO `kpi` VALUES ('679', 'ไอที-จำนวนครั้งของการเกิด downtime ของระบบ ICT และระยะเวลาในการกู้คืน(หน่วย:ครั้ง)', 'จำนวนครั้งของการเกิด downtime ของระบบ ICT และระยะเวลาในการกู้คืน', '197', 'KPI010');
INSERT INTO `kpi` VALUES ('670', 'บัญชีการเงิน-จำนวนครั้งที่หน่วยตรวจสอบให้แก้ไข(หน่วย:ครั้ง)', 'จำนวนครั้งที่หน่วยตรวจสอบให้แก้ไข(สำหรับประเมินพนักงานบัญชี)', '197', 'KPI001');
INSERT INTO `kpi` VALUES ('671', 'บัญชีการเงิน-จำนวนครั้งที่ขาดสภาพคล่อง/กระทบงานอื่นๆ(หน่วย:ชั่วโมง)', 'จำนวนครั้งที่ขาดสภาพคล่อง/กระทบงานอื่นๆ(สำหรับประเมินพนักงานบัญชี)', '197', 'KPI002');
